// ShoppingLists.js
import React from 'react';

const ShoppingLists = ({ lists, onDeleteList, onViewList }) => {
  return (
    <div>
      <h2>Shopping Lists</h2>
      {lists.map(list => (
        <div key={list.id}>
          <span onClick={() => onViewList(list.id)}>{list.name}</span>
          {list.owner && <button onClick={() => onDeleteList(list.id)}>Delete</button>}
        </div>
      ))}
      <button>Create New Shopping List</button>
    </div>
  );
};

export default ShoppingLists;
